const channelReducers = (states=[],action)=>{
    switch (action.type){
        case 'UPDATE_DATA':
            return states.map(state=>state._id)
            return action.payload;
        case 'FETCH_CHANNELS':
            
        default:
            return states;
    }
}
export default channelReducers;
